INSERT INTO `course_setting` VALUES (1, 'Python数据处理与展示', '我们正步入一个数据或许比软件更重要的新时代。——Tim O\'Reilly” 运用数据是精准刻画事物、呈现发展规律的主要手段，分析数据展示规律，把思想变得更精细！ ——“弹指之间·享受创新”，通过8周学习，你将掌握利用Python语言表示、清洗、统计和展示数据的能力。', '08:00:00', '11:30:00', '5号楼', 3.0, 1, 1000, '2024-02-29', '2024-07-31', NULL, '2024-03-30 00:25:53.850114', '2024-04-04 17:44:22.367245', 3, 'course_picture/485C64A7504CECA2F8FF346AC6DE1D71.webp');
INSERT INTO `course_setting` VALUES (2, '计算机组织与结构', '计算机基础', '09:50:00', '11:30:00', '1号楼', 2.5, 1, 1000, '2024-02-29', '2024-08-30', NULL, '2024-03-31 00:00:59.366099', '2024-04-06 17:16:21.476495', 4, 'course_picture/f979aeb022f6440d8af3f4dd99b7c321.png');
INSERT INTO `course_setting` VALUES (3, '深度学习及其应用', 'Python语言', '13:30:00', '17:00:00', '1号楼', 2.5, 1, 1000, '2024-03-13', '2024-07-19', NULL, '2024-04-01 01:40:36.934333', '2024-04-06 17:22:17.434684', 2, 'course_picture/E366E2BD77B090A5CAFA54861308F9CB.webp');
INSERT INTO `course_setting` VALUES (4, '人工智能原理', '在汹涌澎湃的科技创新大潮中，人工智能时代已经到来，准备好去拥抱这个时代了吗？那么，究竟什么是人工智能？人工智能研究什么？人工智能的理论基础是什么？其最新的发展与应用会如何影响我们的社会、工作和生活？本课程将系统介绍人工智能的发展历程、核心思想、基本理论与应用。', '08:00:00', '09:40:00', '1号楼', 1.0, 2, 100, '2024-04-04', '2024-06-24', NULL, '2024-04-04 17:14:03.337739', '2024-04-10 14:46:34.914127', 1, 'course_picture/B4839DBDE2346ADEAB71918D799EB73D.webp');
INSERT INTO `course_setting` VALUES (6, '云计算技术与应用', '云计算是分布式计算、并行计算、效用计算、 网络存储、虚拟化、负载均衡等传统计算机和网络技术发展融合的产物。 我们身处云计算和大数据时代，已经在“云”端学习与生活。为了系统学习云计算技术，请加入“云计算技术与应用”课程吧！我们将带领你进入云中开启云计算之旅！', '08:00:00', '09:40:00', '1号楼', 1.0, 2, 100, '2024-04-05', '2024-08-24', NULL, '2024-04-05 00:27:08.783015', '2024-04-05 01:09:36.283142', 2, 'course_picture/EEBB8E840E0598286E8238186730978C_WjVJ7Mq.webp');
INSERT INTO `course_setting` VALUES (4874221981290987522, '大数据算法', '大数据在不论在研究还是工程领域都是热点之一，算法是大数据管理与计算的核心主题。本课程试图简要介绍大数据计算中涉及到的基本算法设计方法。适用于大数据研究与开发人员，也适用于数据科学爱好者。', '08:00:00', '09:40:00', '3号楼', 1.0, 1, 176, '2024-03-06', '2024-05-16', NULL, '2024-04-05 07:58:55.000000', '2024-04-10 23:28:53.040709', 5, 'course_picture/d317930622ed4a33a9ca35347964cd3b.webp');
INSERT INTO `course_setting` VALUES (4874221981290987524, '自主移动机器人', '本课程介绍自主移动所涉及的轮式运动学建模、导航规划、环境感知、里程估计、自主定位方面的基本概念和基础算法，帮助学习者了解自主移动的核心问题、经典算法和发展趋势，为学习者开展机器人自主移动方面的研究奠定基础。与往次课程相比，本次课程在理论知识介绍的基础上，将增加导航部分仿真实践平台和算法实践方面的介绍。', '13:30:00', '15:10:00', '1号楼', 2.4, 2, 643, '2024-03-04', '2024-06-21', NULL, '2024-04-05 03:01:21.000000', '2024-04-06 15:16:18.953531', 3, 'course_picture/C1833CE0210351BAA7AD4CCAB55D11CA.webp');
INSERT INTO `course_setting` VALUES (4874221981290987526, '模式识别与机器学习', '模式识别的原理和方法在医学、军事等众多领域应用十分广泛，是计算机及其相关专业进行科学研究的基础。课程构建了以经典推理决策为明线、前沿机器学习为暗线，明暗螺旋递进的内容体系，有效串接贝叶斯推理、线性判据、神经网络、深度学习等知识模块。同时，高维微积分、矩阵分析、优化理论等高阶数学知识与课程专业内容无缝嵌入衔接。此外，概率统计、代数、几何等技术路线之间前后呼应。该体系既融入了最新的机器学习研究成果，又明晰了广大分散知识点之间的关联，避免学习出现知识孤岛。', '09:50:00', '11:30:00', '2号楼', 2.4, 3, 532, '2024-04-05', '2024-06-28', NULL, '2024-04-05 04:19:25.000000', '2024-04-07 19:13:16.574124', 2, 'course_picture/D8CF1D7BA361BCDC22FE6F449A58BCE1.webp');
INSERT INTO `course_setting` VALUES (4874221981290987528, '空中机器人', '区别于传统的大型军事无人机，空中机器人泛指一类具有高度智能化的无人自主飞行器。它是人工智能与现代飞行器结合的产物，也是机器人科学与技术发展最为活跃的领域之一。此课程的主要目标是让学生了解空中机器人的基本概念，基本理论和主要研究方法，向学生展示空中机器人的最新应用和研究成果，并展望这种机器人的发展趋势。', '09:50:00', '11:30:00', '5号楼', 2.9, 1, 267, '2024-03-29', '2024-06-25', NULL, '2024-04-05 04:39:41.000000', '2024-04-06 15:23:32.961593', 4, 'course_picture/5F06804EAF12468D6CF0459F5725E568.webp');
INSERT INTO `course_setting` VALUES (4874221981290987530, '大数据思维与技术', '大数据分析基础认知、核心架构、计算模式，大数据与信息安全对抗，大数据与自然语言处理，大数据与生物信息处理等。即见树木又见森林，重点引导培养有竞争力的数据与计算能力：综合运用计算机和数学知识分析处理大规模数据集的能力，从复杂数据中快速得到信息和发现关系的能力，现实世界具体问题的建模能力等。深入先进地培养学生的跨界整合与全球思维及科学创造与发现精神。同时，注重其间接效果，融入人文素养的培养，教学过程中同时讨论算法的可用性、道德、隐私、法律、知识产权保护、经济和社会影响等。', '13:30:00', '15:10:00', '3号楼', 2.7, 2, 139, '2024-02-01', '2024-04-09', NULL, '2024-04-05 04:33:58.000000', '2024-04-30 00:05:29.330355', 1, 'course_picture/7BA1653E38C5B999C223BAA707CC78A1.webp');
INSERT INTO `course_setting` VALUES (4874221981290987532, '灵境——虚拟现实技术的应用', '虚拟现实（Virtual Reality）也称人工环境，是一种可以创建和体验虚拟世界的计算机仿真系统，提供使用者关于视觉、触觉、听觉等感官模拟。我们相信它将成为下一代计算平台，深刻改变人们的社交方式、学习方式以及生产、生活的方式。', '13:30:00', '15:10:00', '5号楼', 1.0, 2, 831, '2024-04-10', '2024-06-21', NULL, '2024-04-05 03:57:02.000000', '2024-04-06 16:35:09.501621', 2, 'course_picture/B31FCE263C0097CB9A2333F9FA2E4FEC.webp');
INSERT INTO `course_setting` VALUES (4874221981290987534, '机器人基础原理', '《机器人基础原理》是顺应当前机器人技术的快速发展以及人才的迫切需求而开设的，是机器人工程专业的基础主干课程之一，学习对象是大学二年级以上本科学生及其他各类感兴趣的人员。', '13:30:00', '15:10:00', '1号楼', 2.7, 2, 999, '2024-04-05', '2024-06-28', NULL, '2024-04-05 16:05:45.000000', '2024-04-07 16:52:14.851231', 4, 'course_picture/C8FF21457C037DA0EFAB93C2B975B59C.webp');
INSERT INTO `course_setting` VALUES (4874221981290987536, '大数据技术原理与应用', '课程的定位是入门级课程，本课程的目标是为学生搭建起通向“大数据知识空间”的桥梁和纽带。本课程将系统梳理总结大数据相关技术，介绍大数据技术的基本原理和大数据主要应用，帮助学生形成对大数据知识体系及其应用领域的轮廓性认识，为学生在大数据领域“深耕细作”奠定基础、指明方向。', '13:30:00', '17:00:00', '4号楼', 1.4, 2, 764, '2024-03-19', '2024-06-14', NULL, '2024-04-05 20:43:14.000000', '2024-04-07 20:53:45.572473', 2, 'course_picture/675E300748D0411D513DFB31BD27063C.webp');
INSERT INTO `course_setting` VALUES (4874221981290987538, '数据挖掘', '数据挖掘是近十几年来大数据、人工智能行业飞速发展最重要的驱动技术之一，当前大数据分析几乎都离不开数据挖掘技术，因此掌握数据挖掘的相关知识技能对于学生当下就业和未来深造都有重要意义。', '15:20:00', '17:00:00', '2号楼', 1.4, 2, 382, '2024-03-21', '2024-06-21', NULL, '2024-04-05 07:02:58.000000', '2024-04-10 16:37:54.437023', 1, 'course_picture/F05ADA2CD454710CFF6D216D35512FBF.webp');
INSERT INTO `course_setting` VALUES (4874221981290987540, '生物大数据', '“大数据”是时下最火热的词汇，是各行业人士争相追捧的利润焦点。自1977年2月，Sanger与他的同事发表了第一个生物体的完整基因组序列以来，生物学大数据时代也宣告来临。生物学大数据技术的战略意义不在于掌握庞大的数据信息，而在于对这些大数据所蕴含生物学知识的提取。', '13:30:00', '15:10:00', '3号楼', 2.5, 1, 585, '2024-03-22', '2024-05-02', NULL, '2024-04-05 01:46:39.000000', '2024-04-07 00:20:05.843067', 6, 'course_picture/281446128D1F4FD0A79317B4F859E254.webp');
INSERT INTO `course_setting` VALUES (4874221981290987542, '数字图像处理', '图像处理是生物医学工程领域学生中一门关键的专业基础课；面向对象是有着一定专业背景的计算机、软件专业，医学院和生物医学工程专业学生；课程的目的是培养学生对近年来迅猛发展的医学图像的构成、存储、分析、理解以及临床应用具备基本的知识掌握.', '08:00:00', '09:40:00', '5号楼', 2.5, 2, 593, '2024-04-22', '2024-06-06', NULL, '2024-04-05 02:08:31.000000', '2024-04-30 00:05:13.074529', 4, 'course_picture/4D92F351693BAF3E4C6069DE3ACF3AF9.webp');
INSERT INTO `course_setting` VALUES (4874221981290987544, '新结构区域经济学', '融合中国原创的新结构经济学思想；凸显中国特色的区域问题治理理论与经验；充满中国元素和时代特征。', '09:50:00', '11:30:00', '3号楼', 2.6, 2, 368, '2024-03-01', '2024-06-28', NULL, '2024-04-05 23:52:00.000000', '2024-04-10 23:28:16.444631', 5, 'course_picture/4B75EC84C098BBFEF28E4378C25DF40C.webp');
INSERT INTO `course_setting` VALUES (4874221981290987546, '生态经济学', '涵盖生态经济学最核心内容和方法；随时+变化的特色和时代特征；充满中国元素和文化素养。欢迎走进《生态经济学》大课堂。', '15:20:00', '17:00:00', '3号楼', 2.3, 1, 950, '2024-03-18', '2024-05-23', NULL, '2024-04-05 09:22:57.000000', '2024-04-07 00:37:44.361916', 5, 'course_picture/9B896341C68E103869E4CF42CB8FECF4.webp');
INSERT INTO `course_setting` VALUES (4874221981290987548, '经济学实战密码', '《经济学实战密码》是经济学实战类的最具有代表性的课程之一。本课程围绕当前的宏观经济背景，采用以经济学理论紧密联系实际的方式，用经济学思维分析现实问题，并提出相应的解决措施。对于经济学学子、政府规划者、企业战略投融资等人群均具有适用性。', '13:30:00', '15:10:00', '5号楼', 2.2, 1, 285, '2024-03-12', '2024-06-03', NULL, '2024-04-05 09:36:40.000000', '2024-04-07 00:40:10.938681', 5, 'course_picture/C394C22177737F34621C6314EB6AC32A.webp');
INSERT INTO `course_setting` VALUES (4874221981290987550, '经济学导论', '《经济学导论》介绍经济学的基本概念、基本理论和基本方法，包括微观经济学和宏观经济学的部分，涵盖了经济学的主要范畴。通过本课程的学习，同学们可以了解和掌握经济学的基本概念、基本原理和基本分析方法，为进一步的学习微观经济学、宏观经济学及其他经济类专业课程打下坚实的基础。', '13:30:00', '15:10:00', '4号楼', 1.0, 1, 127, '2024-04-12', '2024-05-16', NULL, '2024-04-05 13:21:34.000000', '2024-04-10 23:28:03.175808', 3, 'course_picture/c0109ddd871644e4a001232a9c0f19aa_4KGMFLt.jpg');
INSERT INTO `course_setting` VALUES (4874221981290987552, '应用回归分析', '应用回归分析是统计学的重要分支，是数据科学的基础方法，主要研究如何从数据出发，揭示变量间的统计联系。 本课程主要介绍经典回归分析的基本理论和实用方法，并体现了统计学与机器学习的有机结合。本课程以Python为教学语言，使学生具备应用专业知识解决实际问题的能力。', '09:50:00', '11:30:00', '1号楼', 2.5, 1, 482, '2024-03-07', '2024-05-24', NULL, '2024-04-05 08:49:56.000000', '2024-04-10 23:27:53.277571', 5, 'course_picture/7EB7E9638D862DBDCC6C2121D21127A5.webp');
INSERT INTO `course_setting` VALUES (4874221981290987554, '中级财务会计', '您还在为学习会计而忧心忡忡吗？请加入财务会计学习之旅吧！ 本课程重点突出， 深入浅出通俗易懂，剖析各个重点、难点、方法与实务工作之间的联系。讲授细致，循循善诱，让难点变得简单易学，附之以课程团队的无缝服务，相信你一定会学有所获！让我们共同在中财的旅途中结伴前行！走向理想的彼岸！', '15:20:00', '17:00:00', '2号楼', 0.6, 3, 261, '2024-04-01', '2024-05-16', NULL, '2024-04-05 20:15:01.000000', '2024-04-10 23:27:38.378348', 2, 'course_picture/f55096efa4594c45b801530c21d3b7d0.webp');
INSERT INTO `course_setting` VALUES (4874221981290987556, '基础会计', '基础会计是了解和学习财务会计知识的起点，通过本课程的学习，大家可以掌握会计的基本理论、基本方法和基本技能。学习本课程之后，进一步学习中级财务会计、财务管理和管理会计、审计等相关知识，即可进入会计行业，从事会计核算、财务管理、管理会计、审计等相关工作。', '08:00:00', '11:30:00', '3号楼', 2.3, 2, 955, '2024-03-11', '2024-06-15', NULL, '2024-04-05 04:59:10.000000', '2024-04-18 22:00:47.722425', 3, 'course_picture/20AD37C76948A20F16BC6D4874795DD5.webp');
INSERT INTO `course_setting` VALUES (4874221981290987558, '成本会计学', '《成本会计学》是会计学、审计学、财务管理等财会类专业的主干课程。本课程立足于财务会计，对接管理会计，主要以成本核算为主线，介绍成本会计的基本理论与方法。本课程突出创新性思维和能力培养，具有实用性、开放性特点。适合本专科学生、财会类的专业硕士以及从事财会类教学与实践工作人员的学习。', '09:50:00', '11:30:00', '1号楼', 1.5, 2, 600, '2024-03-06', '2024-06-07', NULL, '2024-04-05 04:26:25.000000', '2024-04-18 21:36:08.036196', 3, 'course_picture/97b37217f7694396ae6ce0483fcc7e9c.jpg');
